import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
const eventFiles = require.context("./events", false, /\.json$/);
const eventsData = eventFiles.keys().map((key) => eventFiles(key)); // Načteme JSON soubory s eventy

const DisciplineLive = () => {
  const { eventName, disciplineName } = useParams();
  const navigate = useNavigate();
  const [data, setData] = useState([]);
  const [googleSheetsId, setGoogleSheetsId] = useState("");

  // 1️⃣ Načtení správného Google Sheets ID podle eventu
  useEffect(() => {
    const fetchEventData = async () => {
      try {
        const event = eventsData.find((e) => e.name.replace(/\s+/g, "-").toLowerCase() === eventName);
        if (event && event.googleSheetsId) {
          setGoogleSheetsId(event.googleSheetsId);
        } else {
          console.error("Google Sheets ID nenalezeno pro event:", eventName);
        }
      } catch (error) {
        console.error("Chyba při načítání eventu:", error);
      }
    };

    fetchEventData();
  }, [eventName]);

  // 2️⃣ Načítání dat z Google Sheets
  useEffect(() => {
    if (!googleSheetsId) return;

    const fetchData = async () => {
      const sheetRange = disciplineName.replace(/\s+/g, "_") + "!A8:H20"; // Automaticky vytvoří název listu
      const url = `https://docs.google.com/spreadsheets/d/${googleSheetsId}/gviz/tq?tqx=out:json&sheet=${sheetRange}`;

      try {
        const response = await fetch(url);
        const text = await response.text();
        const json = JSON.parse(text.substring(47, text.length - 2));
        const rows = json.table.rows.map((row) => row.c.map((cell) => (cell ? cell.v : "")));
        setData(rows);
      } catch (error) {
        console.error("Chyba při načítání dat:", error);
      }
    };

    fetchData();
    const interval = setInterval(fetchData, 30000); // Aktualizace každých 30 sekund
    return () => clearInterval(interval);
  }, [googleSheetsId, disciplineName]);

  return (
    <div className="p-4">
      {/* Tlačítko zpět */}
      <button onClick={() => navigate(`/event/${eventName}`)}>⬅️ Back to {eventName.replace(/-/g, " ")}</button>

      {/* Název disciplíny */}
      <h1 className="text-3xl font-bold mt-4">{disciplineName.replace(/-/g, " ")}</h1>
      <p className="text-gray-600">Live Results</p>

      {/* Tabulka výsledků */}
      <table className="w-full border-collapse border border-gray-300 mt-4">
        <thead>
          <tr className="bg-gray-200">
            <th className="border border-gray-300 p-2">Rnk</th>
            <th className="border border-gray-300 p-2">Bib</th>
            <th className="border border-gray-300 p-2">Name</th>
            <th className="border border-gray-300 p-2">Country</th>
            <th className="border border-gray-300 p-2">Time 200m</th>
            <th className="border border-gray-300 p-2">Time 100m</th>
            <th className="border border-gray-300 p-2">Avg Speed</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index} className="text-center">
              <td className="border border-gray-300 p-2">{row[0]}</td>
              <td className="border border-gray-300 p-2">{row[1]}</td>
              <td className="border border-gray-300 p-2">{row[2]} {row[3]}</td>
              <td className="border border-gray-300 p-2">{row[4]}</td>
              <td className="border border-gray-300 p-2">{row[5]}</td>
              <td className="border border-gray-300 p-2">{row[6]}</td>
              <td className="border border-gray-300 p-2">{row[7]}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DisciplineLive;
